import React from 'react';
import { Container } from 'react-bootstrap';
//import {Link} from 'react-router-dom';
//import './styles.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';



function Rodape() {
  
  return (
    <Container fluid>
        <img
              src="./fb-logo.svg"
              width="20"
              height="20"
              
              alt="React fb logo"
            />
    <Navbar   bg="warning" variant="light" className="justify-content-center" expand="lg"> 
    <Nav  defaultActiveKey="/home" as="ul">
          <Navbar.Brand href="#home">
            <img
              src="./fb-logo.svg"
              width="20"
              height="20"
              className="d-inline-block align-bot"
              alt="React fb logo"
            />
          </Navbar.Brand>
          
      <Nav.Item as="li">
        <Nav.Link href="/contatos">Reservas</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href="/Intranet">WhatsApp</Nav.Link>
      </Nav.Item>
    </Nav>
    </Navbar>
    </Container>
         
  );
}

export default Rodape;
